import axios from 'axios';
export default {
  data() {
    return {
      name: "",
      email: "",
      password: "",
      city: "",
      street: "",
      zipcode: ""
    };
  },
  methods: {
    async memberCreate() {
      try {
        const registerData = {
          name: this.name,
          email: this.email,
          password: this.password,
          city: this.city,
          street: this.street,
          zipcode: this.zipcode
        };
        // axios는 비동기함수이므로 async-await 해주지 않으면 .push먼저 동작함
        await axios.post('http://localhost:8080/member/create', registerData);
        this.$router.push("/");
      } catch (e) {}
    }
  }
};
